import UserData from './components/UserData';



function App() {


  let url = 'https://geektrust.s3-ap-southeast-1.amazonaws.com/adminui-problem/members.json';
  let usersDetails;
  try {
    usersDetails = fetch(url)
      // Handle success
      .then(response => {
        return response.json();
      })  // convert to json
      .then((data) => {
        usersDetails = data;
      })
  } catch (error) {
    console.log(error);

  }
  console.log(usersDetails);

  return (
    <div>
      <input type='search'></input>
      <UserData items={usersDetails}></UserData>

    </div>
  );
}

export default App;
